CREATE TABLE Handler(
   HandlerID SERIAL PRIMARY KEY NOT NULL,
   FirstName VARCHAR(20) NOT NULL,
   LastName  VARCHAR(20) NOT NULL,
   Email     VARCHAR(50) NOT NULL UNIQUE,
   Password  VARCHAR(75) NOT NULL,
   Role      CHAR(5) NOT NULL
);

CREATE TABLE Prison(
   PrisonID   SERIAL PRIMARY KEY NOT NULL, 
   PrisonName VARCHAR(66) NOT NULL,
   City       VARCHAR(30) NOT NULL,
   Capacity   INTEGER NOT NULL
);

CREATE TABLE PoliceStation(
   StationID SERIAL PRIMARY KEY NOT NULL,
   Name      VARCHAR(35) NOT NULL,
   City      VARCHAR(13) NOT NULL
);

CREATE TABLE CrimeCase(
   CrimeID SERIAL PRIMARY KEY NOT NULL,
   City       VARCHAR(30) NOT NULL,
   Street     VARCHAR(40) NOT NULL,
   ZipCode    INTEGER  NOT NULL,
   OccurDate  DATE  NOT NULL,
   OccurTime  TIME NOT NULL,
   Status     VARCHAR(6) NOT NULL,
   StationID   INTEGER  NOT NULL,
   HandlerID   INTEGER  NOT NULL,
   FOREIGN KEY (HandlerID) REFERENCES Handler(HandlerID),
   FOREIGN KEY (StationID) REFERENCES PoliceStation(StationID) 
);

CREATE TABLE Criminal(
   CriminalID SERIAL PRIMARY KEY NOT NULL, 
   FirstName  VARCHAR(20) NOT NULL,
   LastName   VARCHAR(20) NOT NULL,
   DOB        DATE  NOT NULL,
   Gender     CHAR(6) NOT NULL,
   Race       VARCHAR(20) NOT NULL,
   PrisonID   INTEGER  NOT NULL,
   FOREIGN KEY (PrisonID) REFERENCES Prison(PrisonID)
);

CREATE TABLE Police(
   PoliceID  SERIAL PRIMARY KEY NOT NULL, 
   FirstName VARCHAR(20) NOT NULL,
   LastName  VARCHAR(20) NOT NULL,
   Rank      VARCHAR(21) NOT NULL,
   DOB       DATE NOT NULL,
   JoinDATE  DATE NOT NULL,
   StationID INTEGER NOT NULL,
   FOREIGN KEY (StationID) REFERENCES PoliceStation(StationID)
);

CREATE TABLE Victim(
   VictimID  SERIAL PRIMARY KEY NOT NULL,
   FirstName VARCHAR(20) NOT NULL,
   LastName  VARCHAR(20) NOT NULL,
   Gender    CHAR(6) NOT NULL,
   DOB       DATE  NOT NULL,
   Race      VARCHAR(20) NOT NULL     
);

CREATE TABLE Type(
   TypeID SERIAL PRIMARY KEY NOT NULL,
   CrimeName   VARCHAR(20) NOT NULL
);

CREATE TABLE Investigate(
   CrimeID     INTEGER  NOT NULL,
   PoliceID    INTEGER  NOT NULL,
   StartDate   DATE NOT NULL,
   EndDate     DATE NOT NULL,
   FOREIGN KEY (CrimeID) REFERENCES CrimeCase(CrimeID) ON DELETE CASCADE,
   FOREIGN KEY (PoliceID) REFERENCES Police(PoliceID) ON DELETE CASCADE
);

CREATE TABLE CrimeType(
   TypeID INTEGER NOT NULL,
   CrimeID INTEGER NOT NULL,
   IBRCode VARCHAR(5) NOT NULL,
   FOREIGN KEY (CrimeID) REFERENCES CrimeCase(CrimeID) ON DELETE CASCADE,
   FOREIGN KEY (TypeID) REFERENCES Type(TypeID) ON DELETE CASCADE
);

CREATE TABLE CriminalVictimCase(
   CrimeID INTEGER  NOT NULL,
   CriminalID  INTEGER  NOT NULL,
   VictimID INTEGER NOT NULL,
   PrisonYears INTEGER NOT NULL,
   FOREIGN KEY (CrimeID) REFERENCES CrimeCase(CrimeID) ON DELETE CASCADE,
   FOREIGN KEY (CriminalID) REFERENCES Criminal(CriminalID) ON DELETE CASCADE,
   FOREIGN KEY (VictimID) REFERENCES Victim(VictimID) ON DELETE CASCADE
);

CREATE INDEX ON CrimeCase(CrimeID);
CREATE INDEX ON CrimeCase(StationID);
CREATE INDEX ON CrimeCase(HandlerID);
CREATE INDEX ON Handler(HandlerID);
CREATE INDEX ON CriminalVictimCase(CrimeID);
CREATE INDEX ON CriminalVictimCase(CriminalID);
CREATE INDEX ON CriminalVictimCase(VictimID);
CREATE INDEX ON Criminal(CriminalID);
CREATE INDEX ON Criminal(PrisonID);
CREATE INDEX ON Prison(PrisonID);
CREATE INDEX ON CrimeType(CrimeID);
CREATE INDEX ON CrimeType(TypeID);
CREATE INDEX ON Type(TypeID);
CREATE INDEX ON Victim(VictimID);
CREATE INDEX ON Investigate(CrimeID);
CREATE INDEX ON Investigate(PoliceID);
CREATE INDEX ON Police(PoliceID);
CREATE INDEX ON Police(StationID);
CREATE INDEX ON PoliceStation(StationID);























